  false,\n\t\"url\": null,\n\t\"notes\": \"Chemical, physical and profile oceanographic
  data were collected aboard the CAPE HATTERAS in the Gulf of Mexico from 2010-09-04
  to 2010-09-15 in response to the Deepwater Horizon Oil Spill event on April 20,
  2010, by the Subsurface Monitoring Unit (SMU), which consisted of multiple government
  and corporate agencies. These data include CDOM fluorescence, conductivity, dissolved
  oxygen, fluorescence, hydrostatic pressure, salinity, sound velocity, temperature
  and water density. The instruments used to collect these data included CTD, fluorometer
  and oxygen meter along with other physical sampling devices. More specific information
  about each data set is located in their individual metadata records. The CTD data
  underwent preliminary quality assurance and control procedures at the National Coastal
  Data Development Center (NCDDC). Cruise level information consisting of data management
  documents, cruise reports and plans, videos and pictures, and other miscellaneous
  documentation were gathered by the data managers. (NODC Accession 0069059)\",\n\t\"owner_org\":
